def vertical_text():
    import sys
    input = sys.stdin.read
    data = input().split()

    N = int(data[0])
    strings = data[1:]

    M = max(len(s) for s in strings)

    for i in range(M):
        T_i = []
        for j in range(N-1, -1, -1):
            if i < len(strings[j]):
                T_i.append(strings[j][i])
            else:
                T_i.append('*')
        while T_i and T_i[-1] == '*':
            T_i.pop()
        print(''.join(T_i))

