def kthCharacter(k):
    n = 0
    while (n * (n + 1)) // 2 < k:
        n += 1

    # Calculate the exact position of k within the concatenated string
    remaining_length = k - ((n * (n + 1)) // 2)
    current_string_length = n

    # Determine the character at the remaining_length position
    if remaining_length == 0:
        return 'a'
    else:
        return chr(97 + (remaining_length - 1) % 26)

